description:
Filmen tar sin borjan i september 1861 nar den ikoniske Jesse James samlar ihop ett gang lokala busar och annat lost folk fran trakten for att organisera ett tagran i Blue Cut, Missouri. Bland dessa hittas Robert Ford, en ettrig 19-arig grabb med en stor langtan efter att bli lika omtalad som mannen som samlat dem, han avgudar Jesse James, eller atminstone myten som byggts upp kring honom i bockerna som han strecklaser. Frank, Jesses aldre och mer sammanbitne bror anar orad och skickar forst ivag grabben men Jesse tar honom under sina vingar och snart ar han en av hans narmaste man. Vi far folja Roberts resa fran att ovetande vara.......



Org.titel:  The Assassination of Jesse James by the Coward Robert Ford 



